import React from "react";
import "../css/About.css";
import profileImg from "../assets/images/ljy.jpg";

function About() {
  return (
    <section id="about">
      <h2>About Me</h2>
      <div className="about-container">
        <img src={profileImg} alt="profile" className="profile-img" />
        <p className="about-desc">
          프론트엔드 개발자 이재용입니다. 사용자 경험을 고려한 UI/UX와
          안정적인 서비스 구현에 관심이 많습니다.
        </p>
        <ul className="about-info">
          <li><strong>이름:</strong> 이재용</li>
          <li><strong>생년월일:</strong> 1999.01.01</li>
          <li><strong>이메일:</strong> example@email.com</li>
          <li><strong>학력:</strong> ○○대학교 컴퓨터공학과</li>
          <li><strong>연락처:</strong> 010-1234-5678</li>
        </ul>
      </div>
    </section>
  );
}

export default About;
